import React, { useState, useEffect, Component } from 'react';
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Form from 'react-bootstrap/Form';
/*import { DatePicker } from "react-rainbow-components";*/
import { DemoContainer } from '@mui/x-date-pickers/internals/demo';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';

import logo from '../Images/clubhouse.jpg';

import '../pages/club-house.css';

function ClubHouse() {

    const [booking, setBookings] = useState([]);

    const url = "https://localhost:44311/api/controller/GetAllBookings";

    useEffect(() => {
        axios.get(url)
            .then(response => {
                // If the defualt appears this indicates that no payment has been made
                
                console.log(response.data);
                setBookings(response.data);
                console.log(response.data);
            })
            .catch(error => {
                console.error(error);
            });           
    }, []);

    function actionRefund (bookingId) {
        alert("Refund Will be processed using booking Id : " + bookingId);
        

    }



    return (
        <div class="container">
            <div>
                <h2 className='booking-h2'> Make a Booking for the Club House </h2>
            </div>

            <div>
                {/* Form for Booking the club house */}
                {/* Show date calender for available dates  */}
                <div className='row booking-row'>
                    <div className='col-lg-6'>
                        <img src={logo} alt="Logo" height={350} width={400} />
                    </div>
                   <div className='col-lg-6'>

                       
                        <div className='row deposit-row'>
                            <Form>
                                <Form.Group>
                                    <h4> Pick a Date </h4> 
                                        <LocalizationProvider dateAdapter={AdapterDayjs}>
                                            <DemoContainer components={['DatePicker']}>
                                                <DatePicker label="Select a date" disablePast />
                                            </DemoContainer>
                                        </LocalizationProvider>

                                </Form.Group>
                                <Form.Group className="mb-3" controlId="formBasicName">
                                    <Form.Label>Number of Guests</Form.Label>
                                        {/*<Form.Control onChange={this.handleChange} type="text" placeholder="Enter your name" />*/}
                                    <Form.Control type="text" placeholder="Enter the number of guests you are expecting" />
                                </Form.Group>

                                <Form.Group className="mb-3" controlId="formBasicLastName">
                                    <Form.Label>Booking Purpose</Form.Label>
                                        {/*<Form.Control onChange={this.handleChange} type="text" placeholder="Enter your name" />*/}
                                    <Form.Control type="text" placeholder="Enter your Booking Purpose" />
                                </Form.Group>

                               {/* <Form.Label>Bank Name</Form.Label>
                                <Form.Select aria-label="Default select example">
                                    
                                    <option>Select Bank </option>
                                    <option value="1"> Capitec </option>
                                    <option value="2"> Absa </option>
                                    <option value="3"> African  Bank </option>
                                    <option value="3"> FNB </option>
                                    <option value="3"> Discovery Bank </option>
                                    <option value="3"> Nedbank </option>
                                    <option value="3"> Stanbic  </option>
                                    <option value="3"> Tyme Bank </option>
                                    <option value="3"> FirstRand Bank </option>
                                    <option value="3"> Grindrod Bank </option>
                                    <option value="3"> HBZ Bank </option>
                                    <option value="3"> Investec Bank </option>
                                    <option value="3"> Mercantile Bank </option>
                                    <option value="3"> Rand Merchant Bank </option>
                                    <option value="3"> RMB Private Bank  </option>
                                    <option value="3"> South African Bank of Athens Limited </option>
                                    <option value="3"> Sasfin Bank Ltd </option>
                                    <option value="3"> Standard Bank of SA </option>
                                    <option value="3"> Wesbank </option>
                                    <option value="3">Standard Bank </option>
                                </Form.Select> */}
                                
                                <Button variant="primary" type="submit">  Pay Deposit </Button>
                            </Form>
                        </div>
                    </div>
                </div>

            </div>



            <div>
                <h2> Previous Bookings </h2>
            </div>
            <div class="row">
                <table class="table table-striped">
                    <thead class="thead-dark">
                    <tr>
                        <th> Booking Date </th>
                        <th> User Email </th>
                        <th> Booking Purpose </th>
                        <th> Payment Date </th>
                        <th> No: Of Guests  </th>
                        <th> Call To Action </th>
                    </tr>
            
                    </thead>
                    <tbody>
                        {
                            booking.map((book, index) =>  {
                                return<tr key={index}>
                                    {/* Td for Booking ID */}
                                    <td>{book.bookingDate}</td>
                                    <td>{book.profileId}</td>
                                    <td>{book.bookingPurpose}</td>
                                    <td>{book.paymentDate}</td>
                                    <td>{book.guestNo}</td>
                                    <td>
                                        <button 
                                            onClick={() => actionRefund(book.bookingId)} 
                                            class="btn btn-primary"> 
                                            Action Refund Process 
                                        </button>
                                    </td>
                                </tr>
                                   
                            })

        
                        }
                    

                    </tbody>
                </table>


            </div>
        </div>
    
      
    )
  }

  export default ClubHouse;
